import React, { useState } from 'react';
import './data.css';
import { useHistory } from 'react-router-dom';
import { Box, TextField, Button, CloseIcon } from '@mui/material';
import axios from 'axios';
import DatePicker from 'react-datepicker';




export default function Data() {
  // const [startDate, setStartDate] = useState(new Date());
  const [config, setConfig] = useState({
    name: '',
    sets: 'number',
    reps: 'number',
    unit: 'number',
    date: 'number',
  });

  let history = useHistory();
  const submit = async (e) => {
    // e.preventDefault();
    try {
      const data = await axios.post('http://localhost:3000/student', config);
    } catch (error) {
      console.log(error);
    }
    history.push('preview');
  };

  return (
    <>
      <div className='data'>
        <div className='mdata'>
          <h1>My Fitness Tracker</h1>
          <div>
            <Box
              component='form'
              sx={{
                '& .MuiTextField-root': { m: 1, width: '25ch' },
              }}
              noValidate
              autoComplete='off'
            >
              <TextField
                required
                id='outlined-basic'
                onChange={(e) =>
                  setConfig((pv) => ({ ...pv, name: e.target.value }))
                }
                label='Exercise Name'
                variant='outlined'
              />
              <TextField
                required
                id='outlined-basic'
                onChange={(e) =>
                  setConfig((pv) => ({ ...pv, sets: e.target.value }))
                }
                label='Sets'
                variant='outlined'
              />
            </Box>
          </div>

          <div>
            <Box
              component='form'
              sx={{
                '& .MuiTextField-root': { m: 1, width: '25ch' },
              }}
              noValidate
              autoComplete='off'
            >
              <TextField
                required
                id='outlined-basic'
                onChange={(e) =>
                  setConfig((pv) => ({ ...pv, reps: e.target.value }))
                }
                label='Reps'
                variant='outlined'
              />
              <TextField
                required
                id='outlined-basic'
                onChange={(e) =>
                  setConfig((pv) => ({ ...pv, unit: e.target.value }))
                }
                label='Unit'
                variant='outlined'
              />
            </Box>
          </div>

          <div>
          {/* <DatePicker
               showIcon
               selected={startDate}
               onChange={(date) => setStartDate(date)}
          /> */}
              
            <Box
              component='form'
              sx={{
                '& .MuiTextField-root': { m: 1, width: '25ch' },
              }}
              noValidate
              autoComplete='off'
            >
              
              <TextField
               
                required
                id='outlined-basic'
                onChange={(e) =>
                  setConfig((pv) => ({ ...pv, date: e.target.value }))
                }
                
                label='Date'
                variant='outlined'
              />
            </Box>
          </div>
          <div>
            <Button variant='contained' onClick={submit}>
              Submit
            </Button>
          </div>
        </div>
      </div>
    </>
  );
}
